<script lang="ts" setup>

const emit = defineEmits(['cancel'])

type Prop ={
    money: number,
    payStr: string
}
const props = defineProps<Prop>()

const handlerCancel=()=>{
    emit('cancel')
}

const handlerConfirm = ()=>{
    console.log(props.payStr)
    const payARR = props.payStr.split(",")
    const token = window.localStorage.getItem("token")
    const sendEntity = {
        "planId": payARR[1],
        "orderId": payARR[0]
    }
    fetch("/api/care/payPlan",{
        headers: {
            'Content-type': 'application/json',
            token: token+""
        },
        method: 'POST',
        body: JSON.stringify(sendEntity)
    }).then(res=>res.json())
    .then(data=>{
        emit('cancel')
    })
}

</script>
